reg chanFilter = Synth.getMidiProcessor("instrumentChannelFilter"); //Instrument level MIDI channel filter
reg playableRangeScript = Synth.getMidiProcessor("playableRange"); //Get playable range script
const var samplerIds = Synth.getIdList("Sampler");
const var containerIds = Synth.getIdList("Container");
const var scriptIds = Synth.getIdList("Script Processor");
reg samplers = [];
reg releaseSamplers = [];
reg rrHandlers = []; //Round robin handlers
reg legatoHandler = Synth.getMidiProcessor("legatoHandler"); //Control panel for switching between sustain, legato, glide
reg sustainRRHandler = Synth.getMidiProcessor("sustainRoundRobin"); //Sustain RR handler - required for special treatment when in legato mode

//Get playable range from script
const var playableRange = [playableRangeScript.getAttribute(0), playableRangeScript.getAttribute(1)];

//Get samplers
for (id in samplerIds)
{
	samplers.push(Synth.getSampler(id)); //Store all samplers

	//Get release sampler
	if (id.indexOf("elease") == -1) continue
	releaseSamplers.push(Synth.getSampler(id));
}

//Get RR handler scripts
for (s in scriptIds) //Each script processor
{
	if (s.indexOf("oundRobin") != -1)
	{
		rrHandlers.push(Synth.getMidiProcessor(s));
	}
}

