//FUNCTIONS
inline function changeBufferSettings(attribute, value)
{
	for (s in samplers)
	{
		s.setAttribute(attribute, bufferSizes[value]);
	}
}

inline function changeRRSettings()
{
	for (r in rrHandlers)
	{
		switch (cmbRR.getValue())
		{
			case 1: //RR off
				r.setAttribute(0, 1);
			break;

			case 2: //Cycle
				for (r in rrHandlers)
				{
					r.setAttribute(0, 0); //Bypass off
					r.setAttribute(1, 0); //Random off
				}
			break;

			case 3: //Random
				for (r in rrHandlers)
				{
					r.setAttribute(0, 0); //Bypass off
					r.setAttribute(1, 1); //Random on
				}
			break;
		}
	}

	if (legatoHandler.getAttribute(0) != 1) //Legato or Glide is enabled
	{
		sustainRRHandler.setAttribute(0, 1); //Bypass sustain RR
	}
}

inline function updateRamDisplay()
{
	lblRam.set("text", Math.round(Engine.getMemoryUsage())+"MB");
