function onControl(number, value)
{
	//articulationEditor.onControlCB(number, value);
	//micMixer.onControlCB(number, value);
	//paramEditor.onControlCB(number, value);

	switch (number)
	{
		case btnPresetBrowser: //Switch to preset browser and settings screen
			if (value == 0)
			{
				tab.hide(tabs[1]);
			}
			else
			{
				updateRamDisplay();
				tab.show(tabs[1]);
			}
		break;

		case cmbChan: //MIDI channel filter
			if (value == 1) //Omni
			{
				chanFilter.setBypassed(true);
			}
			else 
			{
				chanFilter.setBypassed(false);
				chanFilter.setAttribute(0, value-1);
			}
		break;

		case cmbPre: //Preload size
			changeBufferSettings(4, value-1);
			updateRamDisplay();
		break;

		case cmbBuf: //Buffer size
			changeBufferSettings(5, value-1);
			updateRamDisplay();
		break;

		case cmbRR: //Round robin mode
			changeRRSettings();
		break;

		case btnRel: //Load/purge release samples
			for (s in releaseSamplers)
			{
				s.setAttribute(12, 1-value);
			}
			updateRamDisplay();
			btnRel.repaint();
		break;
	}
}

